import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import Navigation from '../common/Navigation';
import UserManagement from './UserManagement';
import EquipmentManagement from './EquipmentManagement';
import ProcessRequests from './ProcessRequests';
import ReportsPage from './ReportsPage';
import { adminAPI } from '../../utils/api';
import { toast } from 'react-toastify';
import './AdminDashboard.css';

const AdminDashboard = () => {
  const navigate = useNavigate();
  const [activeSection, setActiveSection] = useState('dashboard');
  const [dashboardData, setDashboardData] = useState(null);
  const [loading, setLoading] = useState(true);

  const sections = [
    'dashboard',
    'userManagement',
    'equipmentManagement',
    'processRequests',
    'reports'
  ];

  useEffect(() => {
    if (activeSection === 'dashboard') {
      fetchDashboardData();
    }
  }, [activeSection]);

  const fetchDashboardData = async () => {
    try {
      setLoading(true);
      const response = await adminAPI.getDashboardData();
      setDashboardData(response.data);
    } catch (error) {
      console.error('Error fetching dashboard data:', error);
      toast.error('Failed to load dashboard data');
    } finally {
      setLoading(false);
    }
  };

  // ===== LOGOUT HANDLER =====
  const handleLogout = async () => {
    try {
      // Call logout API if you have one
      // await authAPI.logout();

      // Clear any stored auth tokens/data
      localStorage.removeItem('token');
      localStorage.removeItem('user');
      localStorage.removeItem('authToken');
      sessionStorage.clear();

      // Show success message
      toast.success('Logged out successfully');

      // Redirect to home page after a short delay
      setTimeout(() => {
        navigate('/');
      }, 500);
    } catch (error) {
      toast.error('Error logging out');
      console.error('Logout error:', error);
    }
  };

  return (
    <div className="admin-dashboard-container">
      <Navigation onLogout={handleLogout} />

      <div className="dashboard-content">
        <div className="sidebar-navigation">
          {sections.map((section) => (
            <button
              key={section}
              className={`nav-button ${activeSection === section ? 'active' : ''}`}
              onClick={() => setActiveSection(section)}
            >
              {section.charAt(0).toUpperCase() + section.slice(1).replace(/([A-Z])/g, ' $1')}
            </button>
          ))}
          <button 
            className="nav-button logout-btn" 
            onClick={handleLogout}
          >
            Logout
          </button>
        </div>

        <div className="main-content">
          {activeSection === 'dashboard' && (
            <div className="dashboard-section">
              {loading ? (
                <div className="loading-container">Loading...</div>
              ) : (
                <div className="stats-grid">
                  {/* Dashboard stats */}
                  {dashboardData && (
                    <>
                      <div className="stat-card">
                        <h3>Total Equipment</h3>
                        <p className="stat-value">{dashboardData.totalEquipment}</p>
                      </div>
                      <div className="stat-card">
                        <h3>Active Users</h3>
                        <p className="stat-value">{dashboardData.activeUsers}</p>
                      </div>
                      <div className="stat-card">
                        <h3>Pending Requests</h3>
                        <p className="stat-value">{dashboardData.pendingRequests}</p>
                      </div>
                      <div className="stat-card">
                        <h3>System Status</h3>
                        <p className="stat-value">Operational</p>
                      </div>
                    </>
                  )}
                </div>
              )}
            </div>
          )}

          {activeSection === 'userManagement' && <UserManagement />}
          {activeSection === 'equipmentManagement' && <EquipmentManagement />}
          {activeSection === 'processRequests' && <ProcessRequests />}
          {activeSection === 'reports' && <ReportsPage />}
        </div>
      </div>
    </div>
  );
};

export default AdminDashboard;
